import PropTypes from 'prop-types';
import Configuration from './Configuration/Configuration';
import NewConfiguration from './NewConfiguration/NewConfiguration';
import { useState } from 'react';
import EditConfiguration from './EditConfiguration/EditConfiguration';
import CreateConfigurationModal from './CreateConfigurationModal.js/CreateConfigurationModal';

const Configurations = props => {
    const [isEditDrawerVisible, setIsEditDrawerVisible] = useState(false);
    const [isNewConfigurationModalShow, setIsNewConfigurationModalShow] = useState(false);

    const onEditDrawerOpen = () => {
        setIsEditDrawerVisible(true);
    };

    const onEditDrawerClose = () => {
        setIsEditDrawerVisible(false);
    };

    const onNewConfigurationModalShow = () => {
        setIsNewConfigurationModalShow(true);
    };

    const onNewConfigurationModalClose = () => {
        setIsNewConfigurationModalShow(false);
    };

    const onNewConfigurationModalOk = () => {
        setIsNewConfigurationModalShow(false);
    };

    const onNewConfigurationModalCancel = () => {
        setIsNewConfigurationModalShow(false);
    };

    return (
        <>
            <div className='px-6 py-10 flex flex-wrap gap-6'>
                <Configuration
                    title={'Configuration 1'}
                    text={"Today's New's Source, MGT"}
                    onEditDrawerOpen={onEditDrawerOpen}
                    onEditDrawerClose={onEditDrawerClose}
                >
                    Nat config
                </Configuration>
                <Configuration
                    title={'Configuration 2'}
                    text={"Today's New's Source"}
                    onEditDrawerOpen={onEditDrawerOpen}
                    onEditDrawerClose={onEditDrawerClose}
                >
                    Nat config 2
                </Configuration>
                <Configuration
                    title={'Configuration 2'}
                    text={"Today's New's Source"}
                    onEditDrawerOpen={onEditDrawerOpen}
                    onEditDrawerClose={onEditDrawerClose}
                >
                    Nat config 2
                </Configuration>
                <NewConfiguration onModalShow={onModalShow} />
            </div>
            <EditConfiguration
                onEditDrawerOpen={onEditDrawerOpen}
                onEditDrawerClose={onEditDrawerClose}
                isEditDrawerVisible={isEditDrawerVisible}
            />
            <CreateConfigurationModal
                onNewConfigurationModalShow={onNewConfigurationModalShow}
                onNewConfigurationModalClose={onNewConfigurationModalClose}
                onNewConfigurationModalOk={onNewConfigurationModalOk}
                onNewConfigurationModalCancel={onNewConfigurationModalCancel}
                isNewConfigurationModalShow={isNewConfigurationModalShow}
            />
        </>
    );
};

Configurations.propTypes = {};

export default Configurations;
